  \"dissolved-inorganic-carbon-ph-alkalinity-temperature-salinity-and-other-variables-collected-fro659ca\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0112265 includes chemical,
  discrete sample, physical and profile data collected from MIRAI in the North Pacific
  Ocean from 2005-09-13 to 2005-10-27 and retrieved during cruise MR05-04 and PACIFICA_49NZ20050913.
  These data include ALKALINITY, AMMONIUM, DISSOLVED INORGANIC CARBON, DISSOLVED OXYGEN,
  HYDROSTATIC PRESSURE, NITRATE, NITRITE, PHOSPHATE, SALINITY, SILICATE, WATER TEMPERATURE
  and pH. The instruments used to collect these data include CTD, Coulometer for DIC
  measurement and bottle. These data were collected by Makio Honda of Japan Agency
  for Marine-Earth Science and Technology (Jamstec) as part of the PACIFICA_49NZ20050913
  data set.nnPACIFICA (PACIFic ocean Interior CArbon) was an international collaborative
  project for the data synthesis of ocean interior carbon and its related parameters
  in the Pacific Ocean. The North Pacific Marine Science Organization (PICES), Section
  of Carbon and Climate (S-CC) supported the project.\",\n\t\"license_title\": null,\n\t\"extras\":
